import React, { useState } from "react";
import './App.css';

 const App = () => {

  const [fname,setFname]= useState("");
  const [lname,setLname]= useState("");
  const [passwd,setPasswd]= useState("");
  const [data,setData] = useState([]);


    const onsubmit = (e) =>{
      e.preventDefault();
      const data = {firstName : fname , lastName : lname, Password : passwd}
      axios.post("https://jsonplaceholder.typicode.com/photos", {
        id : "8",
        AlbumId:"1",
        title: "Hello World!",
        body: "This is a new post."
      })
      .then((response) => {
        setApidata(response.data);
        console.log(response)
      })

      setData([data]);
    }
   return(
     <>
     <div id="form">
     <form onSubmit={onsubmit}>
      <div>
        <h2> Users Data:</h2>

        <input type="text" id="userinput" placeholder="Enter your first Name"  value={fname} onChange={(e) => setFname(e.target.value)}/><br/><br/>
        <input type="text" id="userinput" placeholder="Enter your last Name"  value={lname} onChange={(e) => setLname(e.target.value)}></input><br/><br/>
        <input type="password" id="userinput" placeholder="Enter Password" value={passwd} onChange={(e) => setPasswd(e.target.value)}></input><br/><br/>
        <input type="submit" id="button" placeholder="submit" onClick={onsubmit}></input>
        <br/>
        </div>
        </form>
        </div>

        {
        data.map((inputs)=>{
          return(
            <>
              <table id="table">
                <tr>
                  <th>firstName</th>
                  <th>lastName</th>
                  <th>Password</th>
                </tr>
                <tr>
                  <td>{inputs.firstName}</td>
                  <td>{inputs.lastName}</td>
                  <td>{inputs.Password}</td>
                 </tr>

            </table>

            </>
          )
        })  
        }

     </>
   );
 }

 export default App
